description:
Bán nhà phố Phú Thượng có tận 2 phòng khách, thiết kế độc đáo, nội thất xịn, cực kỳ sang trọng, không gian thanh bình;
Anh chị Tuấn Hà mới xây năm ngoái nhưng năm nay con lại đậu trường chuyên Amsterdam Hà Nội, gia đình chuyển qua KĐT Trung Hòa, nhà không dùng nên bán;
Nhà mình ngõ thông phố Phú Xá, đi bộ là ra trường THCS Phú Thượng, C3 Tây Hồ, Công an phường và UBND, siêu thị Hưng Long, nhấn ga là ra An Dương Vương, cầu Nhật Tân, Võ Chí Công;
Khu vực cực kì yên tĩnh, thanh bình nhưng lại chẳng thiếu thứ gì.
